import React, { useContext } from "react";
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);
import { GenericDates,GenericDatesProvider } from "./GenericsDate";



function App() {
  const { dados, atualizarDados } = useContext(GenericDates)


  const pegarDado = {...dados.dia}
console.log(pegarDado)

  const dadosDia = ['January', 'February', 'March', 'April','Maio'] 

  // const testeDia = dados.dia
  // console.log(testeDia)

  const dadosFatu = [65, 59, 80, 81,19]

  const data = {


    labels:dadosDia,
    datasets: [
